drop database if exists warehouse1;
create schema warehouse1;
use warehouse1;
create table Category (
	CategoryID INT,
	CategoryName VARCHAR(11),
	Description VARCHAR(4)
);

create table Customer (
	CustomerID INT,
	CustomerName VARCHAR(15),
	Contact VARCHAR(50),
	Address VARCHAR(50),
	Area VARCHAR(15),
	City VARCHAR(9),
	PostalCode VARCHAR(50)
);


create table Orders (
	OrderID INT,
	ProductID INT,
	CustomerID INT,
	TimeID INT,
	Quantity INT
);

create table Product (
	ProductID INT,
	ProductName VARCHAR(41),
	CategoryID INT,
	Price INT,
	Quantity INT
);

create table Time (
	TimeID INT,
	Date INT,
	Month INT,
	Year INT
);
